import React from 'react';
import ReactDOM from 'react-dom';
import CommentDetail from './CommentDetail';

const App=() => {
    return (
    <div className="ui comment container">
        <CommentDetail author="sam" timeago="today at 4:45PM" comment="nice pic"/>
        <CommentDetail author="rainy" timeago="today at 6:00PM" comment="hello nice to see you"/>
        <CommentDetail author="bob" timeago="today at 11:45AM" comment="hey.....! whatsupp"/>
        <CommentDetail author="tom" timeago="today at 3:00PM" comment="beautiful....."/>

    </div>

    );
};
ReactDOM.render(<App/>,document.querySelector('#root'));
